    [Test, Performance]
    public void ContextLSystemDoesManyManySteps()
    {
        LSystemState<float> state = new DefaultLSystemState("C");
        using var basicLSystem = LSystemBuilder.FloatSystem(new string[] {
            "    A > B -> B",
            "C < A     -> C",
            "A < B     -> A",
            "    C > A -> A",
            "    B     -> CA",
            "    C     -> AB",
        });

        Assert.AreEqual("C", state.currentSymbols.Data.ToString());
        state = basicLSystem.StepSystem(state);
        Assert.AreEqual("AB", state.currentSymbols.Data.ToString());
        state = basicLSystem.StepSystem(state);
        Assert.AreEqual("BA", state.currentSymbols.Data.ToString());
        state = basicLSystem.StepSystem(state);
        Assert.AreEqual("CAA", state.currentSymbols.Data.ToString());
        state = basicLSystem.StepSystem(state);
        Assert.AreEqual("ACA", state.currentSymbols.Data.ToString());
        state = basicLSystem.StepSystem(state);
        Assert.AreEqual("AAC", state.currentSymbols.Data.ToString());
        state = basicLSystem.StepSystem(state);
        Assert.AreEqual("AAAB", state.currentSymbols.Data.ToString());
        state = basicLSystem.StepSystem(state);
        Assert.AreEqual("AABA", state.currentSymbols.Data.ToString());
        state = basicLSystem.StepSystem(state);
        Assert.AreEqual("ABAA", state.currentSymbols.Data.ToString());
        state = basicLSystem.StepSystem(state);
        Assert.AreEqual("BAAA", state.currentSymbols.Data.ToString());
        state = basicLSystem.StepSystem(state);
        Assert.AreEqual("CAAAA", state.currentSymbols.Data.ToString());

        Measure.Method(() =>
        {
            state = basicLSystem.StepSystem(state);
        })
            .MeasurementCount(100)
            .IterationsPerMeasurement(100)
            .GC()
            .Run();

        using (state.currentSymbols)
        {
            var expectedResult = "AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAC";
            Assert.AreEqual(expectedResult.Length, state.currentSymbols.Data.Length);
            Assert.AreEqual(expectedResult, state.currentSymbols.Data.ToString());
        }
    }

